			["customText"] = "function()\n    aura_env.result = \"\"\n    aura_env.stacks = {}\n    aura_env.name = {}\n    for unit in WA_IterateGroupMembers() do\n        if WA_GetUnitDebuff(unit, 274358) and UnitGroupRolesAssigned(unit) == \"TANK\" and UnitName(unit) ~= UnitName(\"player\") then\n            aura_env.stacks[unit] = select(3, WA_GetUnitDebuff(unit, 274358))\n            aura_env.name[unit] = UnitName(unit)\n        end\n    end \n    for k,v in pairs(aura_env.name) do\n        aura_env.result = aura_env.result..WA_ClassColorName(aura_env.name[k])..\" - \"..aura_env.stacks[k]..\"\\n\"\n    end\n    \n    return aura_env.result\nend\n\n\n\n\n\n\n\n\n\n\n",
