			},
			["customText"] = "function()\n    aura_env.time = aura_env.time or 0\n    if GetTime() >= aura_env.time+0.3 then\n        aura_env.time = GetTime()\n        aura_env.result = \"\"\n        local count = 0\n        local player = UnitName(\"player\")\n        for i=1,GetNumGroupMembers() do\n            local name = UnitName(GetRaidRosterInfo(i))\n            if name ~= player and count <=1 then\n                local distance = rangecheck(name)\n                if distance <= 8 then\n                    count = count+1\n                end\n            end\n        end\n        local color\n        local result\n        if count >=8 then\n            color = \"|cFF00FF00\" -- green\n            result = color..count..\" in Range\"\n        elseif count >= 5 then\n            color = \"|cFFFFFF00\" -- yellow\n            result = color..count..\" in Range\"\n        else\n            color = \"|cFFFF0000\" -- red\n            result = color..count..\" in Range\"\n        end\n        \n        aura_env.result = result \n    end\n    return aura_env.result\nend",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["customTextUpdate"] = "update",
